import Dialog from '@material-ui/core/Dialog';
import React, { useContext, useEffect, useState } from 'react';


interface InputProps {
  open: boolean;
  onClose: () => void;
  selectedUser: string;
}

export function CompactPlannerView({
  onClose,
  open,
  selectedUser
}: InputProps) {

  const handleClose = () => {
    onClose();
  };

  return (
      <Dialog
        onClose={handleClose}
        open={open}
        fullWidth={true}
        maxWidth={'sm'}
        PaperProps={{
          style: {
            height: '90%',
            backgroundColor: '#fff',
            color: 'black',
            borderRadius: '30px',
            padding: '35px',
            boxShadow: '0px 0px 15px 0px rgba(0,0,0,0.15)',
            transition: 'all 1s'
          },
          elevation: 0
        }}
        BackdropProps={{ style: { backgroundColor: 'rgba(0, 0, 0, 0.25)' } }}
      >
        {selectedUser}
      </Dialog>
  );
}
